                    <svg class="h-2 mr-3" viewBox="0 0 5 5" fill="none" xmlns="http://www.w3.org/2000/svg">
                        <circle cx="2.5" cy="2.5" r="2.5" fill="#081A36" />
                    </svg>
                    REGULARIZAÇÃO DE IMÓVEIS
                </li>
                <p class="w-full text-dark font-light text-justify text-sm">
